import React, {Component} from 'react';
import {connect} from 'react-redux';
import {SortableContainer, SortableElement} from 'react-sortable-hoc';
import NoteSubmit from './NoteSubmit';
import './../style.css';


const renderList = (list) => list.map(elem => <li key={elem.props.id}>{elem}</li>);

class AllNotes extends Component {

    render() {
        return (
            <div className="AllNotes">
                <ol className="uncheckedNotes">
                    {renderList(this.props.uncheckedNotes)}
                </ol>
                <NoteSubmit />
                <ol className="checkedNotes">
                    {renderList(this.props.checkedNotes)}
                </ol>
            </div>
        )
    }
}

const mapStateToProps = state => (
    {
        uncheckedNotes: state.uncheckedNotes,
        checkedNotes: state.checkedNotes
    }
);

export default connect(mapStateToProps)(AllNotes);
